webpackJsonp([83050626864197],{1132:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Gatsby Starter - Forty by HTML5 UP",author:"Hunter Chang"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/google-analytics-unveiled/index.md absPath of file >>> MarkdownRemark",html:'<p>Google have released the google analytics on their google code service – which basically means they’re opening up the API &#x26; stuff like that in a similar way to the way google maps works, and allows you to configure and customise it.</p>\n<p><a href="http://analytics.blogspot.com/2008/09/decoding-google-analytics.html" target="_blank">http://analytics.blogspot.com/2008/09/decoding-google-analytics.html</a></p>\n<p>I wonder what <a href="http://www.aboutnico.be/" target="_blank">Nicolas Lierman</a> (the guy who spent months reverse engineering the API to build an AIR Application version of Google Analytics) feels about them just making it open... (Gutted, I bet)</p>\n<p><strong>Also:</strong> Ever wondered what the difference is between Google Analytics and Urchin software? <a href="http://www.google.com/support/googleanalytics/bin/answer.py?hl=en&amp;answer=55536" target="_blank">http://www.google.com/support/googleanalytics/bin/answer.py?hl=en&#x26;answer=55536</a></p>',frontmatter:{title:"Google Analytics — Unveiled.",date:"September 12, 2008",tags:["apis","google-analytics","google-code"]}}},pathContext:{}}}});
